<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <link rel="icon" type="image/png+xml" href="/All-In-One-store/assets/logo-KKvH9j99.png" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>A to Z Store</title>
    <script type="text/javascript">
      (function (l) {
        if (l.search[1] === "/") {
          var decoded = l.search
            .slice(1)
            .split("&")
            .map(function (s) {
              return s.replace(/~and~/g, "&");
            })
            .join("?");
          window.history.replaceState(
            null,
            null,
            l.pathname.slice(0, -1) + decoded + l.hash
          );
        }
      })(window.location);
    </script>
    <!-- for font-awesome -->
    <script
      src="https://kit.fontawesome.com/0342ab83c6.js"
      crossorigin="anonymous"
    ></script>
    <!-- end font-awesome -->

    <link rel="stylesheet" crossorigin href="/All-In-One-store/assets/index-DA33guEb.css">
  </head>

  </body>
</html>
